MongoDB not adding default date for nested Schemas?<p>I am attempting to add a form result to an existing client in a collection and all form data variables being passed are added successfully, however, a default date variable is not being created and saved despite being in the schema.</p>

<p>Here is the schema:</p>

<pre><code>const mongoose = require('mongoose');
const Schema = mongoose.Schema;

// Create Schema
const FormSchema = new Schema({
    formID: {
        type: String
    },
    formName: {
        type: String
    },
    date_completed: {
        type: Date,
        default: Date.now
    },
    formData: {
        type: JSON
    }
});

const ClientSchema = new Schema({
    clientID: {
        type: String,
        required: true,
        unique: true
    },
    dob: {
        type: Date,
        required: true
    },
    formResults: {
        tags: [
            {
                type: FormSchema
            }
        ]
    }
});

module.exports = Client = mongoose.model('client', ClientSchema);
</code></pre>

<p>And here is the method posting the form results:</p>

<pre><code>router.post('/:id', auth, (req, res) =&gt; {
    Client.update(
        { clientID: req.params.id },
        {
            $push: {
                formResults: {
                    $each: [
                        {
                            formID: req.body.formID,
                            formName: req.body.formName,
                            formData: req.body.formData
                        }
                    ]
                }
            }
        }
    )
        .then(() =&gt; res.json({ success: true }))
        .catch(
            err =&gt; res.status(404).json({ success: false }) &amp;&amp; console.log(err)
        );
});
</code></pre>

<p>I have tried forcing the date by passing <code>date_completed: Date.now</code> with the other form variables but this makes no difference. The results are still saved with no date variable listed. I have also tried dropping the collection and recreating it, this gave no changes. And I have checked the indexes for the collection, for which there is only _id and clientID.</p>

<p>Here is the data in saved in the database when executed and showing there is no date_completed: value.
<a href="https://i.stack.imgur.com/Ts52g.png" rel="nofollow noreferrer">Stored Data</a></p>

