how to count length of aggregate before skip(pagination)<p>I am building an api to get details of jobs and I need to do pagination for it. For pagination I need to get total number of pages, but I'm getting only skip pages. Please help me to get total number of pages before skip.</p>

<pre class="lang-js prettyprint-override"><code>let cJobs = await CrewbiesJobs.GetAllJobs();
let flashJobsResult = [];
let totalPages = 0;
let filter = {};
let queryLimit = parseInt(req.query.limit) || 10;
let pageNo = parseInt(req.query.page) || 1;
let query = {};
if (pageNo &lt; 0 || pageNo === 0) {
  throw new CustomError('invalid page number, should start with 1', HttpStatus.BAD_REQUEST);
}
query.skip = req.query.limit * (pageNo - 1) || 1;
query.limit = queryLimit;

let jobsAggregate = await Jobs.aggregate([{
    $lookup: {
      from: CrewbiesJobs.collection.name,
      localField: "jobId",
      foreignField: "jobId",
      as: "job_docs"
    }
  },
  {
    $unwind: "$job_docs"
  },

  {
    $project: {
      _id: 1,
      jobTitle: 1,
      jobId: 1,
      jobDescription: 1,
      postedDate: 1,
      filter1: 1,
      filter2: 1,
      filter3: 1,
      createdAt: 1,
      updatedAt: 1
    }
  },
  {
    $match: filter
  },
  {
    $skip: query.skip
  },
  {
    $limit: query.limit
  }


]).exec(function(err, doc) {
  if (err) {
    res.send(err);
  } else {
    totalPages = Math.ceil(doc.length / queryLimit);
    if (pageNo &gt; totalPages) {
      throw new CustomError('Invalid page number', HttpStatus.BAD_REQUEST);
    }
    console.log('matched jobs ', doc.length);
    res.json({
      msg: 'Jobs listed successfully',
      item: {
        totalPages: doc.length,
        currentpage: pageNo,
        jobs: doc
      },
      jobsCount: doc.length
    });
  }
});
}
catch (err) {
  CustomError.Handle(err, res);
}

</code></pre>

<p><em><code>totalPages</code></em> counts should return 21 but am getting only 10 instead:</p>

<pre><code>*{
  "msg": "Jobs listed successfully",
  "item": {
    "totalPages": 10,
    "currentpage": 1,
  },
  "jobsCount": 10
}*
</code></pre>

