Order of Operations in `before` and `describe` blocks in Mocha/Chai Node Tests<p>To try and understand the execution order of one of my Mocha tests (where I was seeing functions execute out of order), I created the following simple test case:</p>

<pre><code>describe("methods", function () {
  before(async function () {
    console.log('---------- BEFORE ------------');
    let sum = 1 + 2;
    console.log('sum: ', sum);
  });
  describe("test case", async function () {
    console.log('---------- AFTER ------------');
  });
});
</code></pre>

<p>Again, all I wanted to check here was the order of operations. And sure enough, in this case, all that prints to the console is <code>------------ AFTER ------------</code>. The logging from the <code>before</code> block doesn't show up in the console at all. </p>

<p>Why is this? What am I missing here?</p>

<p>In my actual test case I use the <code>before</code> block to create and save a document. And then in the next <code>describe</code> block I look it up in the db. When I ran into issues where the document was being looked up before creation had happened I decided to do some simpler tests. Hence what you see above. </p>

